import { fromJS } from "immutable";

const defaultState = fromJS({
  topicItem: [
    {
      id: 1,
      title: "社會熱點",
      imgUrl: "https://miro.medium.com/max/640/1*vLaybAP69yhyWbz7chAEiQ.jpeg",
    },
    {
      id: 2,
      title: "手繪",
      imgUrl:
        "https://img.51miz.com/Element/01/02/09/52/5d0d28a2_E1020952_dc1c3bf7.jpg",
    },
  ],
  articleList: [
    {
      id: 1,
      title: "【青•故事优选C】爱你像爱个孩子",
      imgUrl:
        "https://upload-images.jianshu.io/upload_images/626318-f5839214dcf1170a.jpg?imageMogr2/auto-orient/strip|imageView2/2/format/webp",
      desc:
        "林柳青儿会员扶持计划 文/红耳兔小姐姐 1 有时我会突然忘记，我还爱着柯颂。 已经不记得这是第几次，我们为究竟谁来洗碗而冷战 ，也不清楚到底有多...",
    },
    {
      id: 2,
      title: "舒淇情史：与黎明相恋7年终无果，和张震约定婚期最后新娘却不是她",
      imgUrl:
        "https://upload-images.jianshu.io/upload_images/626318-f5839214dcf1170a.jpg?imageMogr2/auto-orient/strip|imageView2/2/format/webp",
      desc:
        "4月16日晚，冯德伦在社交平台发布了和妻子舒淇的合照为其庆生，并附文祝舒淇生日快乐、永远18岁、永远美丽。随后，舒淇也搞笑却不失甜蜜地回应道：.."
    },
  ],
});

export default (state = defaultState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};
